import axios from "axios";
import { AuthData, FormAuthData } from "../signup";

const client = axios.create({ baseURL: "http://localhost:3000" });

export const signUp = async (data: AuthData) => {
  const res = client.post("/auth/signUp", data);
  return res;
};
